		<script>
		// define mouse position functions
		L.Control.MousePosition = L.Control.extend({
		  options: {
			 position: 'bottomright',
			 separator: ' : ',
			 emptyString: 'Unavailable',
			 lngFirst: false,
			 numDigits: 5,
			 lngFormatter: undefined,
			 latFormatter: undefined,
			 prefix: ""
		   },

		   onAdd: function (map) {
			 this._container = L.DomUtil.create('div', 'leaflet-control-mouseposition');
			 L.DomEvent.disableClickPropagation(this._container);
			 map.on('mousemove', this._onMouseMove, this);
			 this._container.innerHTML=this.options.emptyString;
			 return this._container;
		   },

		   onRemove: function (map) {
			 map.off('mousemove', this._onMouseMove)
		   },

		   _onMouseMove: function (e) {
			 var lng = this.options.lngFormatter ? this.options.lngFormatter(e.latlng.lng) : L.Util.formatNum(e.latlng.lng, this.options.numDigits);
			 var lat = this.options.latFormatter ? this.options.latFormatter(e.latlng.lat) : L.Util.formatNum(e.latlng.lat, this.options.numDigits);
			 var value = this.options.lngFirst ? lng + this.options.separator + lat : lat + this.options.separator + lng;
			 var prefixAndValue = this.options.prefix + ' ' + value;
			 this._container.innerHTML = prefixAndValue;
		   }
		   });

		   L.Map.mergeOptions({
			 positionControl: false
	    	 });

	   	   L.Map.addInitHook(function () {
			 if (this.options.positionControl) {
				 this.positionControl = new L.Control.MousePosition();
				 this.addControl(this.positionControl);
			 }
		   });

		   L.control.mousePosition = function (options) {
			 return new L.Control.MousePosition(options);
		   };
		</script>

        var bounds = null;
        // Map
        var map = L.map('map', {
            center: [39.32367,-120.2221],
            zoom: 11,
            maxBounds: bounds,
            minZoom: 1,
            maxZoom: 16,
            worldCopyJump: false,
            crs: L.CRS.EPSG3857,
            layers: [mapbox_satellite]
        });

		L.control.mousePosition().addTo(map);
        // Title
        var title = L.control();
        title.onAdd = function(map) {
            this._div = L.DomUtil.create('div', 'ctl title');
            this.update();
            return this._div;
        };
        title.update = function(props) {
            this._div.innerHTML = "CSP Wood Supply Model (Beta)";
        };
        title.addTo(map);
       
        // add legend
        var tsnetbmLegend = L.control({position: 'bottomright'});
        var tsnetqmdLegend = L.control({position: 'bottomright'});
        var tsnetbaLegend = L.control({position: 'bottomright'});
        var tsnetccLegend = L.control({position: 'bottomright'});

        L.control.scale().addTo(map);

        tsnetbmLegend.onAdd = function(map){
            var div = L.DomUtil.create('div', 'info legend');
            div.innerHTML +='<img src="https://storage.googleapis.com/csp-wood-supply-app-v1_0_0/biomass_colorbar.png" alt="legend" height="250">';
            return div;
        };

        tsnetqmdLegend.onAdd = function(map){
            var div = L.DomUtil.create('div', 'info legend');
            div.innerHTML +='<img src="https://storage.googleapis.com/wood-supply/assets/cbar_class1.png" alt="legend" height="250">';
            return div;
        };

        tsnetbaLegend.onAdd = function(map){
            var div = L.DomUtil.create('div', 'info legend');
            div.innerHTML +='<img src="https://storage.googleapis.com/csp-wood-supply-app-v1_0_0/basalarea_colorbar.png" alt="legend" height="250">';
            return div;
        };

        tsnetccLegend.onAdd = function(map){
            var div = L.DomUtil.create('div', 'info legend');
            div.innerHTML +='<img src="https://storage.googleapis.com/csp-wood-supply-app-v1_0_0/canopycvr_colorbar.png" alt="legend" height="250">';
            return div;
        };

        function getViridisColor(d) {
            return d > 400 ?'#B8DE29FF' :
                d > 150  ? '#55C667FF' :
                d > 50  ? '#29AF7FFF' :
                d > 10  ? '#1F968BFF' :
                d > 1   ? '#2D708EFF' :
                d > 0.01   ? '#453781FF' :
                '#FFFFFF' ;
            };

        var ecobjLegend = L.control({position: 'bottomright'});

        ecobjLegend.onAdd = function (map) {
            var div = L.DomUtil.create('div', 'info legend'),
            //grades = [0, 0.002, 0.02, 0.1, 1, 10, 50, 150,400],
            grades = [400, 150, 50, 10, 1, 0.01, 0],
            labels = ['MBF/Acre'],
            from, to;

            for (var i = 0; i < grades.length; i++) {
                from = grades[i];
                to = grades[i + 1];

                labels.push(
                '<i style="background:' + getViridisColor(from + 1) + '"></i> ' +
                from + (to ? '&ndash;' + to : '+'));
                }

                div.innerHTML = labels.join('<br>');
                return div;
        };

        //L.Control.setOpacityControlMap(map);

        var opacitySlider = new L.Control.opacitySlider();
        //opacitySlider.setOpacityLayer(tsnet_bm);
        //map.addControl(opacitySlider);

        //add more opacity slider layers

        opacitySlider.addOpacityLayer(tsnet_bm);
        opacitySlider.addOpacityLayer(tsnet_qmd);
        opacitySlider.addOpacityLayer(tsnet_ba);
        opacitySlider.addOpacityLayer(tsnet_canopy);
        opacitySlider.addOpacityLayer(ecobj);

        map.on('overlayadd', function(eventLayer){
            if(eventLayer.name == "CSP tsnet Biomass (Mg/ha)"){
                this.addControl(opacitySlider);
                tsnetbmLegend.addTo(this);
            }
            else if(eventLayer.name == "CSP tsnet QMD (inches)"){
                this.addControl(opacitySlider);
                tsnetqmdLegend.addTo(this);
            }
            else if(eventLayer.name == "CSP tsnet BA (ft2/acre)"){
                this.addControl(opacitySlider);
                tsnetbaLegend.addTo(this);
            }
            else if(eventLayer.name == "CSP tsnet Canopy Cover (%)"){
                this.addControl(opacitySlider);
                tsnetccLegend.addTo(this);
            }
            else if(eventLayer.name == "TKRD 2014 EcObject pTotMBF"){
                this.addControl(opacitySlider);
                ecobjLegend.addTo(this);
            };
        });
            
        map.on('overlayremove', function(eventLayer){
            if(eventLayer.name == "CSP tsnet Biomass (Mg/ha)"){
                this.removeControl(tsnetbmLegend);
            }
            else if(eventLayer.name == "CSP tsnet QMD (inches)"){
                this.removeControl(tsnetqmdLegend);
            }
            else if(eventLayer.name == "CSP tsnet BA (ft2/acre)"){
                this.removeControl(tsnetbaLegend);
            }
            else if(eventLayer.name == "CSP tsnet Canopy Cover (%)"){
                this.removeControl(tsnetccLegend);
            }
             else if(eventLayer.name == "TKRD 2014 EcObject pTotMBF"){
                this.removeControl(ecobjLegend);
            } ;           
        });

        // Note
        var src = 'Generated by <img src="https://csp-wild-suit-2.appspot.com/img/CSP_logo_pronghorn_BW_no_text.png" height="20"><a href="http://www.csp-inc.org">Conservation Science Partners</a>, Copyright &copy; 2018';

        var title = L.control({position: 'bottomleft'});

        title.onAdd = function(map) {
            this._div = L.DomUtil.create('div', 'ctl src');
            this.update();
            return this._div;
        };
        title.update = function(props) {
            this._div.innerHTML = src;
        };
        title.addTo(map);

        // geoJSON of the boundary...
        //var twsStyle = {
        //    "color": "#FF0000",

        //    "opacity": 0.5,
        //    "fillOpacity":0
        //};

        var basemaps = {
            "No basemap" : L.tileLayer(''),
            "Mapbox Satellite": mapbox_satellite, 
            "Mapbox Topo": mapbox_terrain, 
            "OpenTopoMap": OpenMap,
            };

        var overlaymaps = {
            "CSP tsnet Biomass (Mg/ha)": tsnet_bm, 
            "CSP tsnet QMD (inches)": tsnet_qmd, 
            "CSP tsnet BA (ft2/acre)": tsnet_ba, 
            "CSP tsnet Canopy Cover (%)": tsnet_canopy, 
            "TKRD 2014 EcObject pTotMBF": ecobj
        };

        var lcontrol = L.control.layers(basemaps, overlaymaps, {collapsed: true, position: 'topleft'}).addTo(map);
